INSERT INTO `tbl_blogs` (`blog_id`, `blog_title`, `blog_description`, `created_by`, `datetime_created`, `last_updated`) VALUES
('blog_1528895499', 'Another victory for century mill Kamgar Ekta Manch.', 'Workers of century mill yarn mill got 63 years of pension with the help of century mill Kamgar Ekta Manch', 'ganeshmukkera.ri@gmail.com', '2018-06-13 23:41:39', '0000-00-00 00:00:00'),
('blog_1534960580', '06 July 2018', 'Workers took the decision today to take possession of all the mill workers in Koregaon-Khatav taluka and take possession of their house in the Koregaon Bhairavnath temple.\r\nHemant Gosavi, Balasaheb Ghanavat, Ravidar Shinde, Vilas Bhosale, Shirish Pawar, the leader of the Century Mill Workers Union Forum, guided the workers.', 'ganeshmukkera.ri@gmail.com', '2018-08-23 04:26:20', '0000-00-00 00:00:00'),
('blog_1534961287', 'Another step forward for the historic decision', 'Mill workers are struggling under the leadership of Medha Patkar to start the century Yarn MVP Khargone Mill.\r\nThe demand for the same work as the century Mill Mumbai should be given to those workers\r\nOn 6/4/2018 initiated century Mill kamgar Ekta Mancha.', 'ganeshmukkera.ri@gmail.com', '2018-08-23 04:38:07', '0000-00-00 00:00:00'),
('blog_1534961843', 'Financing help from the hands of Shri Nandu Parker', 'Century Yarn Denim (MP) Khargone Mill Worker Jitendra Dhangar committed suicide by bribing owner of Kumar Mangal Birla Sheet.\r\nTwo year old Chumukah was waiting for her father .She was sad.\r\nNandu Parkar, the chairman of CMKEM stood for financial help for the victims family. Nandu Parakar gave the trust that we are with you people to Jitendra Dhangar family.', 'ganeshmukkera.ri@gmail.com', '2018-08-23 04:47:23', '0000-00-00 00:00:00'),
('blog_1534969002', 'Tanaji Kadam guided the workers on 21/8/2018 at 11.00 am', 'Workers union leader Hemant Gosavi, Tanaji Kadam guided the workers on 21/8/2018 at 11.00 am in the morning on the Ekta Manch at Padli, Koregaon.', 'ganeshmukkera.ri@gmail.com', '2018-08-23 06:46:42', '0000-00-00 00:00:00'),
('blog_1534969121', 'Meeting of the mill workers of Koregaon section was held today at Bhairavnath temple on 22/8/2018', 'Meeting of the mill workers of Koregaon section was held today at Bhairavnath temple on 22/8/2018, Labor leader Hemant Gosavi, Vilas Bhosale, Balasaheb Ghanvat, Shivaji Gadve, Shamrao Pawar, gave guidance to the workers.', 'ganeshmukkera.ri@gmail.com', '2018-08-23 06:48:41', '0000-00-00 00:00:00'),
